import React from "react";
import styled from "styled-components";

const Section = styled.section`
  width: 100vw;
  height: 25rem;
  position: relative;
  border-top: 2px solid ${(props) => props.theme.body};
`;

const Banner = () => {
  return <div>Banner</div>;
};

export default Banner;
